import React from "react";

const Vote = () => {
  return (
    <>
      <div className="createProp-box">
        <h2>Cast Vote</h2>
        <input type="text" name="" id="" placeholder="Enter Proposal ID" />
        <button type="submit">Vote</button>
      </div>
      ;
    </>
  );
};

export default Vote;
